import React from 'react'
import Room from './Rooms';

export default function RoomsList({rooms}) {
    console.log(rooms)
    return (
        <section className="roomslist">
            <div className="roomslist-center">
            {rooms.map(item =>{
                return <Room rooms={item} className="roomslist-center"></Room>
            })}
            </div>
        </section>
    )
}
